    "summary": "\u003cstrong\u003e\u003cspan style=\"background-color: rgb(255, 255, 255);\"\u003e\u003cspan style=\"color: rgb(79, 97, 40);\"\u003eHey gu\u003c/span\u003e\u003c/span\u003e\u003c/strong\u003e\u003cstrong\u003e\u003cspan style=\"background-color: rgb(255, 255, 255);\"\u003e\u003cspan style=\"color: rgb(79, 97, 40);\"\u003eys, just a Iittle bit about me... \u003cbr\u003e\u003c/span\u003e\u003c/span\u003e\u003c/strong\u003e\u003cbr\u003e\u003cimg src=\"http://www.fredmiranda.com/forum/ufiles/28/1068928.jpg\"\u003e\u003cspan style=\"color: rgb(79, 97, 40);\"\u003eI began modeling in 2010 when I was asked to model for a friend who was learning photography at the time. Through him I began meeting other photographers who were also learning -So really, I started to grow along with them. But I never thought I would be here today with this love for modeling. \u003cbr\u003eI am extremely grateful to have met so many great photographers/artists, make up artists, body painters,... and hope to meet many more.\u00a0\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eThrough my Patreon\u003c/strong\u003e:\u003cbr\u003e\u003c/span\u003e\u003cspan style=\"color: rgb(79, 97, 40);\"\u003eI am ready to share with you photos that tell a story,.. \u003cbr\u003eSexy, tasteful shots, behind the scenes photos/videos, dance videos, and really what ever the hell is going on around me. \u003cbr\u003eI enjoy every bit of creating - but being a freelance model requires a team of support from time to time to be able to keep creating, traveling, providing outfits/makeup, etc.\u00a0\u003cbr\u003eThis is what I love and I want to do, and would love to keep creating for those who enjoy it. \u003cbr\u003eIn turn,\u00a0\u003cbr\u003e\u003cstrong\u003eMost images posted here, you wont find any where else - social media for example. \u003cbr\u003eThat means Patreon Exclusive photos, and never before seen shots from past shoots.\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(79, 97, 40);\"\u003e\u003cbr\u003e\u003cbr\u003e\u003c/span\u003e\u003c/span\u003e\u003cspan style=\"color: rgb(79, 97, 40);\"\u003e\u003cstrong\u003e*****Currently not posting any new content**********\u003c/strong\u003e\u003cbr\u003e\u003c/span\u003e\u003cspan style=\"background-color: rgb(242, 242, 242);\"\u003e\u003cspan style=\"background-color: rgb(36, 64, 97);\"\u003e\u003cbr\u003e\u003c/span\u003e\u003c/span\u003e\u003cspan style=\"color: rgb(255, 255, 255);\"\u003e\u003cem\u003eAL\u003c/em\u003e\u003cbr\u003e\u003c/span\u003e\u003cstrong\u003e\u003cspan style=\"color: rgb(49, 133, 155);\"\u003eInstagram :\u003c/span\u003e \u003c/strong\u003e\u003cspan style=\"color: rgb(75, 172, 198);\"\u003eJanette_Adriana\u003cbr\u003e\u003cbr\u003e\u003cspan style=\"color: rgb(227, 108, 9);\"\u003eAmazon Wish List : jana.azmodel@gmail.com \u00a0\u003c/span\u003e\u003c/span\u003e\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003e**\u003c/strong\u003e\u003cem\u003e\u003cstrong\u003eBONUS REWARDS\u003c/strong\u003e for any\u003c/em\u003e\u003cbr\u003eDonations made through paypal -\u003cbr\u003e\u003cspan style=\"color: rgb(149, 55, 52);\"\u003e\u003cstrong\u003e\u003cspan style=\"color: rgb(31, 73, 125);\"\u003ePayPal:\u00a0jana.azmodel@gmail.com\u003c/span\u003e\u003c/strong\u003e\u003c/span\u003e"
